import logo from './logo.svg';
import Iframe from 'react-iframe'
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Ironsight - Systems Analysis and Design
        </p>
      </header>
        <Iframe url="https://netdata.tylerharrison.dev/"
        width="auto"
        height="auto"
        id="myId"
        className="netdata"
        display="initial"
        position="absolute"
        frameBorder="0"/>
    </div>
  );
}


export default App;
